// Dashboard.js
import React from 'react';
import { NavLink, Outlet } from 'react-router-dom';

const Dashboard = () => {
  return (
    <>
      <h2>Dashboard</h2>
      <nav>
        <ul>
          <li>
            <NavLink to="/dashboard/threat">Threat</NavLink>
          </li>
          <li>
            <NavLink to="/dashboard/overspeed">OverSpeed</NavLink>
          </li>
          <li>
            <NavLink to="/dashboard/helmet">Helmet</NavLink>
          </li>
          <li>
            <NavLink to="/dashboard/deepfake">Deepfake</NavLink>
          </li>
        </ul>
      </nav>
      <Outlet />
    </>
  );
};

export default Dashboard;
